import React from 'react';
import ReactDOM from 'react-dom';
import Jumbotron from 'react-bootstrap/Jumbotron' 
import './index.css';

class Main extends React.Component {
    render() {
        return (
            <Jumbotron fluid>
                <Container>
                    <h1>Blog app</h1>
                    <p>
                    Welcome to my blog app! the location to share your ideas!
                    </p>
                </Container>
            </Jumbotron>
        )
    }
}
